import Banner from 'Components/Banner/Banner'
import styles from './Home.module.css'
import posts from 'json/posts.json'
import Posts from 'Components/Posts/Post'

const Home = () => {
  return (
    <main>
      <Banner />

      <ul className={styles.posts}>
        {posts.map((post) => (
          <li key={post.id}>
            <Post post={post} />
          </li>
        ))}
      </ul>
    </main>
  )
}

export default Home
